public void executeQuery()
{
    QueryBuildRange                 showTransRange;
    ProdTableJour                   prodTableJour;

    if (element.args().dataset() == tableNum(ProdTableJour))
    {
        prodTableJour = element.args().record();
        showTransRange = SysQuery::findOrCreateRange(this.query().dataSourceTable(tableNum(ProdReleaseTrans_RU)),
                                                     fieldNum(ProdReleaseTrans_RU, VoucherWIP));
        showTransRange.value(prodTableJour.Voucher);
    }
    super();
}
